$(function(){$("#classAdminLoginButton").click(function(n){$("#loading-overlay").fadeIn(300),$.ajax({type:"POST",url:"/api/class/teacherAuth",data:JSON.stringify({classId:$("#classId").val(),tPassword:$("#adminPassword").val()}),contentType:"application/json",dataType:"json"}).done(function(n,a,s){window.location.href="/admin/"+n.classId}).fail(function(n,a,s){$("#loading-overlay").fadeOut(300),$("#errorMsg").text(n.responseJSON.msg)})}),$("#adminPassword").keypress(function(n){13==n.which&&$("#classAdminLoginButton").click()}),$("#classId").keypress(function(n){13==n.which&&$("#classAdminLoginButton").click()})});